import React from 'react';
import s from './Item.module.css'
const Item = (props) => {
    return (
        <div className={s.wrapper}>
            <img  className={s.logo} src={props.source} alt=""/>
            <a className={s.operator} href="">{props.content}</a>
        </div>
            );
        }
export default Item;
